column8:
天然のハッカ油でコウモリを撃退！<br>
<br>
【商品説明】<br>
・屋根裏などに生息したコウモリを強力ハッカ臭で追い出します。<br>
・有効成分は天然のハッカ油ですので、安全性が高く安心してご使用いただけます。<br>
・強力ノズルにより、無風状態での水平噴射で最大6mまで届きます。<br>
・屋根裏にあらかじめスプレーすることにより外部からコウモリが侵入するのを防ぎます。<br>
・コウモリの生息場所に噴霧することで追い出し・侵入を防ぐ効果があります。<br>
・効果は3～6時間持続します。<br>
<br>
【使用方法】<br>
・屋根裏などコウモリの生息場所に、1平方メートルあたり2～3秒噴霧して下さい。<br>
　（追い出し終了後コウモリの出入り口を塞ぐことをおすすめします。）<br>
・入口が狭い場所で使用する場合は、付属の専用ノズルをご使用ください。<br>
・長期間忌避したい場合は、姉妹品の「モグラクリン」（錠剤タイプの忌避剤）を併用してください。<br>
<br>
【ご注意ください】<br>
・強力ジェット噴射タイプです。 連続噴射40～45秒で薬剤がなくなります。<br>
・臭気性の忌避財のため、臭気に慣れた、または感受性の乏しいコウモリには効果が出にくい場合があります。<br>
<br>
【有効成分】<br>
天然ハッカ油<br>
<br>
【適用害虫】<br>
コウモリ(追い出し・侵入防止)<br>
<br>
<b>※使用に際しては必ず商品の説明を良く読んで記載内容に従ってお使いください。</b><br>
<br>
【重量】約500g<br>
<br>
<br>
<div style="color: #ff0000; font-size: 9pt; height: 24px;">▼▼長期間忌避したい場合はこちら▼▼</div>
